n    // ===== MECHANICAL COUNTER =====\n    const counterLabel = new PIXI.Text({\n        text: 'Mechanical Counter:',\n        style: {\n            fontSize: 24,\n            fill: 0xaaaaaa\n        },\n        resolution: 2\n    });\n    counterLabel.position.set(100, 100);\n    scene.addChild(counterLabel);\n    // Create mechanical counter\n    const mechanicalCounter = createMechanicalCounter(6); // 6 digits\n    mechanicalCounter.position.set(400, 90);\n    scene.addChild(mechanicalCounter);\n    // Animate counter\n    let currentValue = 0;\n    const targetValue = 999999;\n    const incrementSpeed = 1234; // Increase by this much per frame\n    engine.ticker.add(() => {\n        if (currentValue < targetValue) {\n            currentValue = Math.min(currentValue + incrementSpeed, targetValue);\n            updateMechanicalCounter(mechanicalCounter, currentValue);\n        }\n    });\n    // ===== BITMAP TEXT =====\n    const bitmapLabel = new PIXI.Text({\n        text: 'BitmapText (High Performance):',\n        style: {\n            fontSize: 24,\n            fill: 0xaaaaaa\n        },\n        resolution: 2\n    });\n    bitmapLabel.position.set(100, 200);\n    scene.addChild(bitmapLabel);\n    // BitmapText generated from TTF using BitmapFont.install\n    const bitmapText = new PIXI.BitmapText({\n        text: 'FAST BITMAP TEXT',\n        style: {\n            fontFamily: 'KenneyBlocks',\n            fontSize: 36\n        }\n    });\n    bitmapText.tint = 0x4ECDC4;\n    bitmapText.position.set(100, 240);\n    scene.addChild(bitmapText);\n    // Frequently updating counter (shows BitmapText performance)\n    let frameCount = 0;\n    const fpsCounter = new PIXI.BitmapText({\n        text: 'FPS: 60',\n        style: {\n            fontFamily: 'KenneyBlocks',\n            fontSize: 24\n        }\n    });\n    fpsCounter.tint = 0x00ff00;\n    fpsCounter.position.set(450, 250);\n    scene.addChild(fpsCounter);\n    // Update FPS counter every frame (demonstrates BitmapText performance)\n    let lastTime = performance.now();\n    let fps = 60;\n    engine.ticker.add(() => {\n        frameCount++;\n        const currentTime = performance.now();\n        const delta = currentTime - lastTime;\n        if (delta >= 1000) {\n            fps = Math.round((frameCount * 1000) / delta);\n            fpsCounter.text = `FPS: ${fps}`;\n            frameCount = 0;\n            lastTime = currentTime;\n        }\n    });\n    // ===== STYLED TEXT EXAMPLES =====\n    const stylesLabel = new PIXI.Text({\n        text: 'Text Styles (Rich Formatting):',\n        style: {\n            fontSize: 24,\n            fill: 0xaaaaaa\n        },\n        resolution: 2\n    });\n    stylesLabel.position.set(100, 330);\n    scene.addChild(stylesLabel);\n    // Stroke text\n    const strokeText = new PIXI.Text({\n        text: 'Bold Stroke',\n        style: {\n            fontSize: 32,\n            fill: 0xffffff,\n            stroke: { color: 0xff6b35, width: 4 },\n            padding: 4\n        },\n        resolution: 2\n    });\n    strokeText.position.set(100, 370);\n    scene.addChild(strokeText);\n    // Gradient text (using array of colors)\n    const gradientFill = new PIXI.FillGradient(0, 0, 0, 32 * 1.7);\n    gradientFill.addColorStop(0, 0xff00ff);\n    gradientFill.addColorStop(1, 0x00ffff);\n    const gradientText = new PIXI.Text({\n        text: 'Gradient Fill',\n        style: {\n            fontSize: 32,\n            fill: gradientFill\n        },\n        resolution: 2\n    });\n    gradientText.position.set(100, 420);\n    scene.addChild(gradientText);\n    // Shadow text\n    const shadowText = new PIXI.Text({\n        text: 'Drop Shadow',\n        style: {\n            fontSize: 32,\n            fill: 0xffffff,\n            dropShadow: {\n                alpha: 0.8,\n                angle: Math.PI / 4,\n                blur: 4,\n                color: 0x000000,\n                distance: 5\n            },\n            padding: 10\n        },\n        resolution: 2\n    });\n    shadowText.position.set(100, 470);\n    scene.addChild(shadowText);\n    // Multi-line wrapped text\n    const wrappedText = new PIXI.Text({\n        text: 'This is an example of word-wrapped text. It automatically breaks into multiple lines when it reaches the specified width.',\n        style: {\n            fontSize: 18,\n            fill: 0xdddddd,\n            wordWrap: true,\n            wordWrapWidth: 400,\n            lineHeight: 24\n        },\n        resolution: 2\n    });\n    wrappedText.position.set(100, 530);\n    scene.addChild(wrappedText);\n    // Outline text (stroke only, no fill)\n    const outlineText = new PIXI.Text({\n        text: 'OUTLINE',\n        style: {\n            fontSize: 48,\n            fill: 'transparent',\n            stroke: { color: 0x00ff00, width: 3 },\n            padding: 4\n        },\n        resolution: 2\n    });\n    outlineText.position.set(600, 370);\n    scene.addChild(outlineText);\n    // Animated tint example\n    const animatedText = new PIXI.Text({\n        text: 'ANIMATED',\n        style: {\n            fontSize: 36,\n            fill: 0xffffff,\n            fontWeight: 'bold'\n        },\n        resolution: 2\n    });\n    animatedText.position.set(600, 450);\n    scene.addChild(animatedText);\n    // Animate the tint color\n    let hue = 0;\n    engine.ticker.add(() => {\n        hue = (hue + 1) % 360;\n        animatedText.tint = hslToHex(hue, 100, 50);\n    });\n    // Initialize and start\n    scene.init();\n    engine.start();\n    console.log(' Text Rendering example loaded!');\n    console.log('    Mechanical counter with scrolling digits');\n    console.log('    BitmapText with live FPS counter');\n    console.log('    Rich text styles: gradients, shadows, strokes');\n    console.log('    Animated color-changing text');\n}\n/**\n * Convert HSL to Hex color\n */\nfunction hslToHex(h, s, l) {\n    l /= 100;\n    const a = s * Math.min(l, 1 - l) / 100;\n    const f = (n) => {\n        const k = (n + h / 30) % 12;\n        const color = l - a * Math.max(Math.min(k - 3, 9 - k, 1), -1);\n        return Math.round(255 * color);\n    };\n    return (f(0) << 16) | (f(8) << 8) | f(4);\n}\n/**\n * Creates a mechanical counter with scrolling digit animation\n */\nfunction createMechanicalCounter(numDigits) {\n    const container = new PIXI.Container();\n    const digitContainers = [];\n    const digitWidth = 50;\n    const digitHeight = 80;\n    for (let i = 0; i < numDigits; i++) {\n        const digitContainer = new PIXI.Container();\n        digitContainer.x = i * (digitWidth + 10);\n        // Create background panel\n        const bg = new PIXI.Graphics();\n        bg.rect(0, 0, digitWidth, digitHeight);\n        bg.fill(0x000000);\n        bg.stroke({ color: 0x444444, width: 2 });\n        digitContainer.addChild(bg);\n        // Create mask for digit scrolling\n        const mask = new PIXI.Graphics();\n        mask.rect(5, 5, digitWidth - 10, digitHeight - 10);\n        mask.fill(0xffffff);\n        digitContainer.addChild(mask);\n        // Create scrolling digits container (0-9 vertically)\n        const scrollContainer = new PIXI.Container();\n        scrollContainer.mask = mask;\n        for (let digit = 0; digit <= 9; digit++) {\n            const text = new PIXI.Text({\n                text: digit.toString(),\n                style: {\n                    fontSize: 48,\n                    fill: 0x00ff00,\n                    fontFamily: 'monospace',\n                    fontWeight: 'bold'\n                },\n                resolution: 3\n            });\n            text.anchor.set(0.5);\n            text.position.set(digitWidth / 2, digit * digitHeight + digitHeight / 2);\n            scrollContainer.addChild(text);\n        }\n        digitContainer.addChild(scrollContainer);\n        // Store data using a custom property\n        digitContainer._counterData = { scrollContainer, currentValue: 0, targetValue: 0 };\n        digitContainers.push(digitContainer);\n        container.addChild(digitContainer);\n    }\n    container._counterData = { digitContainers };\n    return container;\n}\n/**\n * Updates the mechanical counter to display a new value with animation\n */\nfunction updateMechanicalCounter(counter, value) {\n    const { digitContainers } = counter._counterData;\n    const valueStr = value.toString().padStart(digitContainers.length, '0');\n    for (let i = 0; i < digitContainers.length; i++) {\n        const digitContainer = digitContainers[i];\n        const counterData = digitContainer._counterData;\n        const { scrollContainer } = counterData;\n        const newTargetValue = parseInt(valueStr[i]);\n        // Update target value\n        counterData.targetValue = newTargetValue;\n        // Animate scroll position\n        const digitHeight = 80;\n        const targetY = -newTargetValue * digitHeight;\n        const currentY = scrollContainer.y;\n        // Smooth scroll animation\n        const diff = targetY - currentY;\n        if (Math.abs(diff) > 0.5) {\n            scrollContainer.y += diff * 0.15;\n        }\n        else {\n            scrollContainer.y = targetY;\n        }\n    }\n}\n"}};let Mw=null,$w=null;async function Iw(t,e=!0){const i=document.getElementById("canvas-container");if(i)if(Bw[t]){i.innerHTML="",Mw=t,e&&(window.location.hash=t),document.querySelectorAll(".example-btn").forEach((t=>{t.classList.remove("active")})),document.querySelector(`[data-example="${t}"]`)?.classList.add("active"),function(t){const e=Bw[t];if(!e)return;const i=document.getElementById("code-container");var n,s;i&&(n=i,s=e.source,$w&&$w.destroy(),$w=new cm({doc:s,extensions:[mb,yw({typescript:!0}),Tw,cm.editable.of(!1),cm.lineWrapping],parent:n}))}(t);try{await Bw[t].init()}catch(t){console.error("Error loading example:",t);const e=t instanceof Error?t.message:"Unknown error";i.innerHTML=`<div class="error">Error loading example: ${e}</div>`}}else consol